// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

import "./Comptroller.sol";
import "./GoodLottery.sol";

contract WishApi {
    Comptroller comptroller;

    struct GoodInfo {
        uint256 goodId;
        uint256 goodValue;
        uint256 publishTime;
        uint256 lockedTime;
        uint256 maintenanceFee;
        uint256 joinedUsers;
        uint256 ticketCounts;
        uint256 balance;
        address winner;
        string goodHash;
        uint256 stage;
        uint256 paybackFee;
        uint256 winnerTime;
        uint256 winnerBlock;
        uint256 winnerIndex;
    }

    struct UserJoinRecord {
        uint256 goodId;
        address user;
        uint256 count;
        bool joined;
        uint256 joinTime;
        uint256 joinBlockNum;
        bool isWinner;
    }

    struct WinnerHistory {
        uint256 goodId;
        address user;
        uint256 count;
        bool joined;
        uint256 joinTime;
        uint256 joinBlockNum;
        bool isWinner;
        uint256 goodValue;
        uint256 blockNum;
        uint256 blockTime;
        uint256 index;
    }

    constructor(Comptroller _comptroller) {
        comptroller = _comptroller;
    }

    function getGoodsLength() public view returns (uint256 len) {
        return comptroller.getGoods().length;
    }

    function getGoodInfo(uint256 index)
        public
        view
        returns (GoodInfo memory good)
    {
        GoodLottery[] memory goodContracts = comptroller.getGoods();
        if (index >= goodContracts.length) return good;

        good.goodId = goodContracts[index].goodId();
        good.goodValue = goodContracts[index].goodValue();
        good.publishTime = goodContracts[index].publishTime();
        good.lockedTime = goodContracts[index].lockedTime();
        good.maintenanceFee = goodContracts[index].maintenanceFee();
        good.joinedUsers = goodContracts[index].getUsers().length;
        good.ticketCounts = goodContracts[index].getTickets().length;
        good.balance = comptroller.token().balanceOf(
            address(goodContracts[index])
        );
        good.winner = goodContracts[index].winner();
        good.goodHash = goodContracts[index].goodHash();
        good.stage = uint256(goodContracts[index].stage());
        (
            uint256 winnerBlock,
            uint256 winnerTime,
            uint256 tickIndex
        ) = goodContracts[index].winnerTime();
        good.winnerTime = winnerTime;
        good.winnerBlock = winnerBlock;
        good.winnerIndex = tickIndex;

        return good;
    }

    function getUserTickets(uint256 index, address user)
        public
        view
        returns (uint256[] memory)
    {
        GoodLottery[] memory goodContracts = comptroller.getGoods();
        if (index >= goodContracts.length) return new uint256[](0);
        GoodLottery good = goodContracts[index];
        (
            address u,
            uint256 count,
            bool joined,
            uint256 joinTime,
            uint256 joinBlockNum
        ) = good.userMapping(user);
        if (!joined || count == 0) {
            return new uint256[](0);
        }

        address[] memory tickets = good.getTickets();
        uint256[] memory ticketIds = new uint256[](count);

        uint256 j = 0;
        for (uint256 i = 0; i < tickets.length; i++) {
            if (tickets[i] == user) {
                ticketIds[j] = i;
                j++;
            }
        }
        return ticketIds;
    }

    function getUserRecord(uint256 index, uint256 num)
        public
        view
        returns (UserJoinRecord memory record)
    {
        GoodLottery[] memory goodContracts = comptroller.getGoods();
        if (index >= goodContracts.length) return record;
        GoodLottery good = goodContracts[index];
        address addr = good.userList(num);
        if (addr != address(0)) {
            return getUserRecord(good, addr);
        }

        return record;
    }

    function getUserRecord(GoodLottery good, address addr)
        public
        view
        returns (UserJoinRecord memory record)
    {
        if (addr != address(0)) {
            (
                address user,
                uint256 count,
                bool joined,
                uint256 joinTime,
                uint256 joinBlockNum
            ) = good.userMapping(addr);
            record.goodId = good.goodId();
            record.user = user;
            record.count = count;
            record.joined = joined;
            record.joinTime = joinTime;
            record.joinBlockNum = joinBlockNum;
        }

        return record;
    }

    function getWinnerHistory()
        public
        view
        returns (WinnerHistory[] memory)
    {
        GoodLottery[] memory goodContracts = comptroller.getGoods();
        WinnerHistory[] memory records = new WinnerHistory[](goodContracts.length);
        uint j = 0;
        for (uint256 i = goodContracts.length - 1; i >= 0; i--) {
            if (goodContracts[i].winner() != address(0)) {
                (
                    uint256 blockNum,
                    uint256 blockTime,
                    uint256 index
                ) = goodContracts[i].winnerTime();
                UserJoinRecord memory record = getUserRecord(
                    goodContracts[i],
                    goodContracts[i].winner()
                );

                records[j] = WinnerHistory({
                    goodId: record.goodId,
                    user: record.user,
                    count: record.count,
                    joined: record.joined,
                    joinTime: record.joinTime,
                    joinBlockNum: record.joinBlockNum,
                    isWinner: true,
                    goodValue: goodContracts[i].goodValue(),
                    blockNum: blockNum,
                    blockTime: blockTime,
                    index: index
                });
                j ++;
            }
        }
        return records;
    }

    function getUserHistory(address user)
        public
        view
        returns (UserJoinRecord[] memory record)
    {
        GoodLottery[] memory goodContracts = comptroller.getGoods();

        record = new UserJoinRecord[](goodContracts.length);
        uint256 j = 0;
        for (uint256 i = 0; i < goodContracts.length; i++) {
            (
                address user,
                uint256 count,
                bool joined,
                uint256 joinTime,
                uint256 joinBlockNum
            ) = goodContracts[i].userMapping(user);
            if (joined && count > 0) {
                record[j] = UserJoinRecord(
                    goodContracts[i].goodId(),
                    user,
                    count,
                    joined,
                    joinTime,
                    joinBlockNum,
                    goodContracts[i].winner() == user
                );
            }
        }
        return record;
    }
}
